import React from 'react'
import './statbar.css'

const StatBar = (props) => {
    return (
        <div className="statbar-wrapper" key={props.stat.stat.name}>
            <label>
                {props.stat.stat.name}

            </label>
        </div>
    )
}

export default StatBar
